import "./App.scss";
import Header from "./components/Header/Header";
import { Link } from "react-router-dom";

const App = () => {
  return (
    <div className="app-container">
      <Header></Header>
      <div>Test link</div>
      <button>
        <Link to="/users">Go to User Page</Link>
      </button>
      <outlet />
      <button>
        <Link to="/admins">Go to Admin Page</Link>
      </button>
    </div>
  );
};

export default App;
